import React from "react";
import "react-responsive-carousel/lib/styles/carousel.min.css";
import { Carousel } from "react-responsive-carousel";

// import "slick-carousel/slick/slick.css";
// import "slick-carousel/slick/slick-theme.css";

const arr = [
  "../../static/images/nhm_img1.jpeg",
  "../../static/images/nhm_img2.jpeg",
  "../../static/images/nhm_img3.jpeg",
  "../../static/images/nhm_img4.jpeg"
];

const settings = {
  dots: true,
  infinite: true,
  speed: 500,
  slidesToShow: 1,
  slidesToScroll: 1
};

function MatchProfiles() {
  return (
    <div className="container">
      <h3 className="fontreg">Matched By Jeevansathi</h3>

      <div className="carousel-container">
        <Carousel
          showStatus={false}
          autoPlay={true}
          showThumbs={false}
          showArrows={true}
          infiniteLoop={true}
        >
          {arr.map(function(image) {
            return (
              <div>
                <img src={image} />
              </div>
            );
          })}
        </Carousel>
      </div>

      <style global jsx>{`
        .container {
          padding: 30px 0px;
          text-align: center;
        }
        h3 {
          color: #34495e;
          font-size: 20px;
          margin: 0px;
          margin-bottom: 25px;
        }
        .carousel-container {
          padding: 0px 30px;
        }
      `}</style>
    </div>
  );
}

export default MatchProfiles;
